  null\n\t}],\n\t\"num_resources\": 6,\n\t\"tags\": [],\n\t\"title\": \"Terrestrial
  Riparian Arthropod Investigations In the Big Beaver Creek Research Natural Area,
  North Cascades National Park Complex, 1995-1996: Part II, Coleoptera\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 11,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2013-03-14T21:49:39.595718\",\n\t\"name\": \"terrestrial-riparian-arthropod-investigations-in-the-big-beaver-creek-research-natural-area-nor\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Wetland and riparian habitats are vital
  to nutrient and energy transfer between aquatic and terrestrial systems, and are
  also major biodiversity foci within landscapes. Arthropods comprise the bulk of
  animal biodiversity and provide a host of essential ecosystem functions accentuated
  by their basal and intermediate positions in trophic webs. While &#147;purely&#148;
  aquatic and terrestrial arthropod faunas are often relatively well known, the same
  cannot generally be said of those arthropods existing at the aquatic-terrestrial
  interface. To this end, a series of pitfall traps was maintained during the snow-free
  seasons of 1995 and 1996 in riparian floristic communities along the lower 13 km
  of Big Beaver Creek. As part of the Big Beaver Creek project, this study of the
  North Cascades National Park Service Complex riparian Coleoptera (beetles) deals
  with one of the largest and most ecologically diverse groups of arthropods to be
  found within the Park Complex. The majority of the arthropods collected during this
  study were beetles, results similar to those of other riparian arthropod surveys.
  The known trophic roles of these beetles range from detritivores to predators. A
  total of 360 species of beetles in 49 families were identified from the 18,766 individuals
  collected. Discounting those species known to be attracted to carrion, almost all
  individuals (90%) were representatives of only four beetle families: Anthicidae,
  Carabidae, Elateridae, and Staphylinidae. Although the vast majority of individuals
  and species were true riparian constituents, some species would normally be found
  only in habitats such as on flowers, under bark or within truly aquatic situations.
  Given the remoteness and essentially pristine condition of the Big Beaver Creek
  study sites, it was surprising to find a few individuals of five species representing
  taxa introduced into North America from Europe. In both years, the Alder Swamp habitat
  had the greatest species richness, while the Gravel Bar habitat had the most unique
  species composition.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
